import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';
import { AppService } from 'src/app/services/app.service';

@Component({
  selector: 'app-business',
  standalone: true,
  imports: [CommonModule],
  templateUrl: './business.component.html',
  styleUrls: ['./business.component.css']
})
export class BusinessComponent {
  newsData: { [key: string]: any } = {};

  constructor(private appService: AppService) {}

  ngOnInit() {
    // Kategoriye göre haberleri çekmek için getNewsByCategory işlevini çağırın
    this.appService.getNewsByCategory('business', (res) => {
      this.newsData = res; // Verileri saklayın
      console.log(this.newsData); // Verileri konsola yazdırın (isteğe bağlı)
    });
  }
}
